import React from 'react';
import { Link } from 'react-router-dom';
import logo_navbar from '../assets/logo_navbar.png';

function TransparentNavbar() {
  return (
    <nav className="bg-gray-400 bg-opacity-50 w-full px-8 py-4 flex justify-between items-center">
      <div className="flex items-center text-2xl font-bold text-black">
        {/* Logo on the left side */}
        <img 
          src={logo_navbar}
          alt="Echoes Of History Logo" 
          className="h-12 w-auto mr-2 object-contain"
          style={{ maxHeight: '50px' }}
        />
        <Link to="/">Echoes Of History</Link>
      </div>
      <div className="flex space-x-4">
        <Link to="/login">
          <button className="flex justify-center items-center min-w-[120px] px-4 py-2 border-2 border-black text-black font-semibold rounded-full hover:border-gray-300 hover:text-gray-300">
            Login
          </button>
        </Link>
        <Link to="/signup">
          <button className="flex justify-center items-center min-w-[120px] px-4 py-2 border-2 border-black text-black font-semibold rounded-full hover:border-gray-300 hover:text-gray-300">
            Get Started
          </button>
        </Link>
      </div>
    </nav>
  );
}

export default TransparentNavbar;
